    letter was sent to Keith Lochmueller to advise him of how his contribution was
    spllit into our accounts and to offer him a chance for a refund.  According to
    AO 2001-17, the Commission has deemed it sufficient to deposit checks exceeding
    the federal limits into our federal account and to then make a transfer to our
    non-federal account for the portion that exceeds the federal limit.  Therefore,
